INSERT INTO `course` (`course_id`, `course_type`, `course_title`, `credit`, `course_level`, `course_term`, `course_desc`, `pre_req`, `external_link`) VALUES
('CHEM101', 'Undergraduate', 'Chemistry', 3, 1, 2, 'Atomic structure, quantum numbers, electronic configuration, periodic table; Properties and uses of noble gases; Different types of chemical bonds and their properties; Molecular structure of compounds; Selective organic reactions; Different types of solutions and their compositions; Phase rule, phase diagram of monocomponent system; Properties of dilute solutions; Thermochemistry, chemical kinetics, chemical equilibria; Ionization of water and pH concept; Electrical properties of Solution.', '', ''),
('CHEM114', 'Undergraduate', 'Inorganic Quantitative Analysis', 1.5, 1, 2, '<b>Volumetric analysis:</b> acid-base titration, oxidation-reduction titration, determination of Fe, Cu, Ca volumetrically.', '', ''),
('CSE100', 'Undergraduate', 'Introduction to Computer Systems', 2, 1, 1, 'Introduction to computations; Early history of computing devices; Computers; Major components of a computer; Hardware: processor, memory, I/O devices; Software: Operating system, application software; Basic architecture of a computer; Basic Information Technology; The Internet; Number system: binary, octal, hexadecimal, binary arithmetic; Basic programming concepts; Program development stages: flow charts; Programming constructs: data types, operators, expressions, statements, control statements, functions, array.', '', ''),
('CSE103', 'Undergraduate', 'Discrete Mathematics', 3, 1, 2, 'Set theory; Relations; Functions; Graph theory; Propositional calculus and predicate calculus; Mathematical reasoning: induction, contradiction and recursion; counting; Principles of inclusion and exclusion; Recurrence relations; Algebraic structures: rings and groups.', '', ''),
('CSE105', 'Undergraduate', 'Structured Programming Language', 3, 1, 2, '<b>Structured programming language:</b> data types, operators, expressions, control structures; Functions and program structure: parameter passing conventions, scope rules and storage classes, recursion; Header files; Preprocessor; Pointers and arrays; Strings; Multidimensional array; User defined data types: structures, unions, enumerations; Input and Output: standard input and output, formatted input and output, file access; Variable length argument list; Command line parameters; Error Handling;  Graphics; Linking; Library functions.\r\n<br>\r\n<b>Reference language:</b>  C', 'CSE100', ''),
('CSE106', 'Undergraduate', 'Structured Programming Language Sessional', 1.5, 1, 2, 'Laboratory works based on CSE 105.', '', ''),
('CSE201', 'Undergraduate', 'Object Oriented Programming Language', 3, 2, 1, 'Philosophy of Object Oriented Programming (OOP); Advantages of OOP over structured programming; Encapsulation, classes and objects, access specifiers, static and non-static members; Constructors, destructors and copy constructors; Array of objects, object pointers, and object references; Inheritance: single and multiple inheritance; Polymorphism: overloading, abstract classes, virtual functions and overriding; Exceptions; Object Oriented I/O; Template functions and classes; Multi-threaded Programming.\r\n<br><br>\r\n<b>Reference languages:</b> C++ and Java. ', 'CSE105', ''),
('CSE202', 'Undergraduate', 'Object Oriented Programming Language Sessional', 1.5, 2, 1, 'Laboratory works based on CSE 201.', '', ''),
('CSE203', 'Undergraduate', 'Data Structures', 3, 2, 1, 'Internal data representation; Abstract data types; Elementary data structures: arrays, lists, stacks, queues, trees, graphs; Advanced data Structures: heaps, Fibonacci heaps, B-trees; Recursion, sorting, searching, hashing, storage management.', 'CSE105', ''),
('CSE204', 'Undergraduate', 'Data Structures Sessional', 0.75, 2, 1, 'Laboratory works based on CSE 203.', '', ''),
('CSE205', 'Undergraduate', 'Digital Logic Design', 3, 2, 1, 'Digital logic: Boolean algebra, De Morgan''s Theorems, logic gates and their truth tables, canonical forms, combinational logic circuits, minimization techniques; Arithmetic and data handling logic circuits, decoders and encoders, multiplexers and demultiplexers; Combinational circuit design; Flip-flops, race around problems; Counters: asynchronous counters, synchronous counters and their applications; PLA design; Synchronous and asynchronous logic design; State diagram, Mealy and Moore machines; State minimizations and assignments; Pulse mode logic; Fundamental mode design.', '', ''),
('CSE206', 'Undergraduate', 'Digital Logic Design Sessional', 1.5, 2, 1, 'Laboratory works based on CSE 205.', '', ''),
('CSE207', 'Undergraduate', 'Algorithms', 3, 2, 2, 'Techniques for analysis of algorithms; Methods for the design of efficient algorithms: divide and conquer, greedy method, dynamic programming, back tracking, branch and bound; Basic search and traversal techniques; Topological sorting; Connected components, spanning trees, shortest paths; Flow algorithms; Approximation algorithms; Parallel algorithms; Algebraic simplification and transformations; Lower bound theory; NP-completeness, NP-hard and NP-complete problems. ', 'CSE103, CSE203', ''),
('CSE208', 'Undergraduate', 'Algorithms Sessional', 0.75, 2, 2, 'Laboratory work based on CSE 207.', '', ''),
('CSE209', 'Undergraduate', 'Digital Electronics and Pulse Techniques', 3, 2, 2, 'Diode logic gates, transistor switches, transistor gates, MOS gates; Logic Families: TTL, ECL, IIL and CMOS logic with operation details; Propagation delay, product and noise immunity; Open collector and high impedance gates; Electronic circuits for flip-flops, counters and register, memory systems, PLAs; A/D and D/A converters with applications; S/H circuits, LED, LCD and optically coupled oscillators; Non-linear applications of OP AMPs; Analog switches.\r\nLinear wave shaping: diode wave shaping techniques, clipping and clamping circuits, comparator circuits, switching circuits; Pulse transformers, pulse transmission, pulse generation; monostable, bistable and astable multivibrators, Schmitt trigger, blocking oscillators and time-base circuit; Timing circuits; Simple voltage sweeps, linear current sweeps.', 'EEE263', ''),
('CSE210', 'Undergraduate', 'Digital Electronics and Pulse Techniques', 1.5, 2, 2, 'Laboratory works based on CSE 209.', '', ''),
('CSE211', 'Undergraduate', 'Theory of Computation', 2, 2, 2, 'Language theory; Finite automata: deterministic finite automata, nondeterministic finite automata, equivalence and conversion of deterministic and nondeterministic finite automata, pushdown automata; Context free languages; Context free grammars; Turing Machines: basic machines, configuration, computing with Turing machines, combining Turing machines; Undecidability.', '', ''),
('CSE214', 'Undergraduate', 'Assembly Language Programming', 1.5, 2, 2, 'Hardware architecture and software architecture; Instruction types and their formats; Assembly program format; Assembly process; Interrupts and system services; Addressing methods; High level control structure formation; Use of subroutines and macros; Numeric processing and string processing; Concurrent processes and high level linking; Disk geometry, file system and file I/O handling.', '', ''),
('CSE300', 'Undergraduate', 'Technical Writing and Presentation', 0.75, 3, 1, 'Issues of technical writing and effective oral presentation in Computer Science and Engineering; Writing styles of definitions, propositions, theorems and proofs; Preparation of reports, research papers, theses and books: abstract, preface, contents, bibliography and index; Writing of book reviews and referee reports; Writing tools: LATEX; Diagram drawing software; presentation tools.', '', ''),
('CSE301', 'Undergraduate', 'Mathematical Analysis for Computer Science', 3, 3, 2, 'Recurrent problems; Manipulation of sums; Number theory; Special numbers; Generating functions.\r\n<br>\r\nRandom variables; Stochastic process; Markov chains: discrete parameter, continuous parameter, birth-death process; Queuing models: birth-death model, Markovian model, open and closed queuing network;  Application of queuing models.', '', ''),
('CSE303', 'Undergraduate', 'Database', 3, 3, 1, 'Concepts of database systems; Models: Entity-Relationship model, Relational model; Relational algebra; SQL; Integrity constraint; Relational database design; File organization and retrieval, file indexing; Transaction manager; Concurrency controller; Recovery manager; Security system; Database administration; Advanced database management systems: distributed, multimedia, object-oriented, object-relational; Some applications using SQL.', '', ''),
('CSE304', 'Undergraduate', 'Database Sessional', 1.5, 3, 1, 'Laboratory works based on CSE 303.', '', ''),
('CSE305', 'Undergraduate', 'Computer Architecture', 3, 3, 1, 'Information representation; Measuring performance; Instructions and data access methods: operations and operands of computer hardware, representing instruction, addressing styles; Arithmetic Logic Unit (ALU) operations, floating point operations, designing ALU; Processor design: datapaths â€“ single cycle and multicycle implementations; Control Unit design - hardwared and microprogrammed; Hazards; Exceptions; Pipeline: pipelined datapath and control, superscalar and dynamic pipelining; Memory organization: cache, virtual memory, channels; DMA and Interrupts; Buses; Multiprocessors: types of multiprocessors, performance, single bus multiprocessors, multiprocessors connected by network, clusters. ', 'CSE205', ''),
('CSE307', 'Undergraduate', 'Software Engineering and Information System Design', 4, 3, 1, 'Concepts of Software Engineering, Software Engineering paradigms, Different phases of software System Development, Different types of information, qualities of information.\r\nProject Management Concepts, Software process and project Metrics, Software Project Planning, Risk Analysis and management, Project Scheduling and Tracking. \r\nAnalysis Concepts and principles: requirement analysis, Analysis modeling, data modeling.\r\nDesign concepts and principles, Architectural design, User Interface design, Object Oriented software development and design: Iterative Development and the Unified Process. Sequential waterfall life cycles, Inception. Use case model for requirement writing, Elaboration using System Sequence Diagram, Domain Model. Visualizing concept classes. UML diagrams, Interaction and Collaboration Diagram for designing Software. Designing Objects with responsibilities. GRASP patterns with General Principles in assigning responsibilities: Information expert, Creator, Low Coupling and High Cohesion, Creating design class diagrams and mapping design to codes. Advanced GRASP patterns: Polymorphism, Pure Fabrication, Indirection, Project Variation. GoF Design Patterns: Adapter, Factory, Singleton, Strategy, Composite, FaÃ§ade, and Observer.\r\nSoftware Testing: White Box and Black Box testing. Basis Path Testing. Testing for specialized environment. Software testing strategies: Unit Testing, Integration Testing, Validation Testing, System Testing, Art of debugging.\r\nAnalysis of System Maintenance and upgrading: Software repair, downtime, error and faults, specification and correction, Maintenance cost models, documentation.\r\nSoftware Quality Assurance, Quality factors. Software quality measures. Cost impact of Software defects. Concepts of Software reliability, availability and safety. Function based metrics and bang metrics. Metrics for analysis and design model. Metrics for source code, testing and maintenance.', '', ''),
('CSE308', 'Undergraduate', 'Software Engineering and Information System Design Sessional ', 1.5, 3, 1, 'Lab works based on CSE307 and a term project.', '', ''),
('CSE309', 'Undergraduate', 'Compiler', 3, 3, 1, 'Introduction to compiling; Basic issues; Lexical analysis; Syntax analysis; Syntax-directed translation; Semantic analysis: type-checking; Run-time environments; Intermediate code generation; Code generation; Code optimization.', 'CSE211', ''),
('CSE310', 'Undergraduate', 'Compiler Sessional', 0.75, 3, 1, 'Laboratory works based on CSE 309 and project works using some lexical analyzer and parser designing tools.', '', ''),
('CSE311', 'Undergraduate', 'Data Communication-I', 3, 3, 1, 'Signal and random processes; Review of Fourier Transform; Hilbert Transform, continuous wave modulation: AM, PM, FM; Sampling theorem; Pulse modulation: PAM, PDM, PPM, PCM, companding, delta modulation, differential PCM; Multiple access techniques: TDM, FDM; Digital modulation: ASK, PSK, BPSK, QPSK, FSK, MSK, constellation, bit error rate (BER); Noise; Echo cancellation; Intersymbol Interference; Concept of channel coding and capacity.', 'MATH243', ''),
('CSE313', 'Undergraduate', 'Operating System', 3, 3, 2, 'Operating System: its role in computer systems; Operating system concepts; Operating system structure; Process: process model and implementation, Inter-Process Communication (IPC), classical IPC problems, process scheduling, multiprocessing and time-sharing; Memory management: swapping, paging, segmentation, virtual memory; Input/Output: hardware, software, disk, terminals, clocks; Deadlock: resource allocation and deadlock, deadlock detection, prevention and recovery; File Systems: files, directories, security, protection; Case study of some operating systems.', '', ''),
('CSE314', 'Undergraduate', 'Operating System Sessional', 1.5, 3, 2, 'Laboratory works based on CSE 313.', '', ''),
('CSE315', 'Undergraduate', 'Microprocessors and Microcontrollers', 3, 3, 2, 'Introduction to 8-bit, 16-bit, and 32-bit microprocessors: architecture, addressing modes, instruction set, interrupts, multi-tasking and virtual memory; Memory interface; Bus interface; Arithmetic co-processor; Microcontrollers; Integrating microprocessor with interfacing chips.', 'CSE205', ''),
('CSE316', 'Undergraduate', 'Microprocessors and Microcontrollers Sessional', 0.75, 3, 2, 'Laboratory works based on CSE 315.', '', ''),
('CSE317', 'Undergraduate', 'Numerical Methods', 3, 3, 2, 'Introduction; Solution of algebraic and transcendental equations:\r\nmethod of iteration, False Position method, Newton-Rhapson method;\r\nSolution of simultaneous linear equations: Cramer''s rule, Iteration\r\nmethod, Gauss-Jordan Elimination method, Choleski''s process;\r\nInterpolation: diagonal and horizontal difference, differences of a\r\npolynomial, Newton''s formula for forward and backward interpolation,\r\nSpline interpolation; Numerical differentiation and integration;\r\nSolution of ordinary differential equations: Euler''s method, Picard''s\r\nmethod, Milne''s method, Taylor''s series method, Runge-Kutta method;\r\nLeast squares approximation of functions: linear and polynomial\r\nregression, fitting exponential and trigonometric functions.', '', ''),
('CSE321', 'Undergraduate', 'Computer Networks', 4, 3, 2, 'Protocol hierarchies; Data link control: HLDC; DLL in Internet; DLL of ATM; LAN Protocols: Standards IEEE 802.*; Hubs, Bridges, and Switches, FDDI, Fast Ethernet; Routing algorithm; Congestion control; Internetworking, WAN; Fragmentation; Firewalls; IPV4, IPV6, ARP, RARP, Mobile IP, Network layer of ATM; Transport protocols; Transmission control protocol: connection management, transmission policy, congestion control, timer management; UDP; AAL of ATM; Network security: Cryptography, DES, IDEA, public key algorithm; Authentication; Digital signatures; Gigabit Ethernet; Domain Name System: Name servers; Email and its privacy; SNMP; HTTP; World Wide Web.', '', ''),
('CSE322', 'Undergraduate', 'Computer Networks Sessional', 0.75, 3, 2, 'Laboratory works based on CSE 321.', '', ''),
('CSE324', 'Undergraduate', 'Software Development', 0.75, 3, 2, 'Term project of making software on some practical problems with sound software engineering practices. ', '', ''),
('CSE400', 'Undergraduate', 'Project and Thesis', 3, 4, 1, 'Study of problems in the field of Computer Science and Engineering.', '', ''),
('CSE401', 'Undergraduate', 'Artificial Intelligence', 3, 4, 1, 'Introduction to old and new AI techniques; Knowledge representation; Propositional and first order logic, inference in first order logic; Frame problem; Search techniques in AI; Game playing; Planning; Probabilistic reasoning; Learning in symbolic and non-symbolic representation; Natural language processing. Introduction to expert system.', '', ''),
