('CSE403', 'Undergraduate', 'Digital System Design', 3, 4, 1, 'Designing I/O system; I/O devices; Designing Microprocessor based system with interfacing chips; Programmable peripheral interface (interface to A/D and D/A converter); Keyboard/display interface; Programmable timer; Programmable interrupt controller, DMA controller;\r\nDesign using MSI and LSI components; Design of memory subsystem using SRAM and DRAM; Design of various components of a computer: ALU, memory and control unit â€“ hardwired and micro programmed; Microprocessor based designs; Computer BUS standards; Design special purpose controllers.', 'CSE315', ''),
('CSE404', 'Undergraduate', 'Digital System Design Sessional', 1.5, 4, 1, 'Laboratory works based on CSE 403.', '', ''),
('CSE409', 'Undergraduate', 'Computer Graphics', 3, 4, 2, 'Graphics hardware: display devices, input devices etc; Basic raster graphics algorithms for drawing 2D primitives; Two-dimensional and three-dimensional viewing, clipping and transformations; Three-dimensional object representations: polygon surface, B-Spline curves and surfaces, BSP trees, Octrees, Fractal-Geometry methods; Visible surface detection methods: Z-buffer method, BSP tree method, Ray casting method; Illumination models; Surface rendering methods: polygon rendering, ray tracing, terrain visualization with height mapping, modeling surface details with texture mapping; Color models; Computer animation.', 'MATH243', ''),
('CSE410', 'Undergraduate', 'Computer Graphics Sessional', 0.75, 4, 2, 'Laboratory works based on CSE 409.', '', ''),
('CSE411', 'Undergraduate', 'Simulation and Modeling', 3, 4, 1, 'Simulation modeling basics: systems, models and simulation; Classification of simulation models; Steps in a simulation study; Concepts in discrete-event simulation: event-scheduling vs. process-interaction approaches, time-advance mechanism, organization of a discrete-event simulation model; Continuous simulation models; Combined discreet-continuous models; Monte Carlo simulation; Simulation of queuing systems.\r\n<br>\r\nBuilding valid and credible simulation models: validation principles and techniques, statistical procedures for comparing real-world observations and simulated outputs, input modeling; Generating random numbers and random variates; Output analysis.\r\nSimulation languages; Analysis and modeling of some practical systems.', '', ''),
('CSE421', 'Undergraduate', 'Basic Graph Theory', 3, 4, 1, 'Graphs: simple graphs, digraphs, subgraphs, vertex-degrees, walks, paths and cycles; Trees, spanning trees in graphs, distance in graphs; Complementary graphs, cut-vertices, bridges and blocks, k-connected graphs; Euler tours, Hamiltonian cycles, Chinese Postman Problem, Traveling Salesman Problem; Chromatic number, chromatic polynomials, chromatic index, Vizingâ€™s theorem, planar graphs, perfect graphs.', '', ''),
('CSE423', 'Undergraduate', 'Fault Tolerant Systems', 3, 4, 1, 'Introduction of Fault Tolerant Systems and architectures; Fault detection and location in combinational and sequential circuits; Fault test generation for combinational and sequential circuits; Digital simulation as a diagnostic tool; Automatic test pattern generator; Fault modeling; Automatic test equipment, faults in memory, memory test pattern and reliability; Performance monitoring, self checking circuits, burst error correction and triple modular redundancy; Maintenance processors.', '', ''),
('CSE433', 'Undergraduate', 'Digital Image Processing', 3, 4, 1, 'Introduction; Digitization of images and its properties; Data structures for image analysis; Image processing; Segmentation: detection of discontinuities, edge linking and boundary detection, thresholding, region oriented segmentation, use of motion in segmentation; Image transforms: Z-transform, 2D Fourier transform, discrete cosine transform, Hadamard transform, Walsh transform, Slant transform; Image compression: run-length coding, transform coding, standards.', '', ''),
('CSE435', 'Undergraduate', 'Basic Multimedia Theory', 3, 4, 1, 'Multimedia systems - introduction; Coding and compression standards; Architecture issues in multimedia; Operating systems issues in multimedia - real-time OS issues, synchronization, interrupt handling; Database issues in multimedia - indexing and storing multimedia data, disk placement, disk scheduling, searching for a multimedia document; Networking issues in multimedia - Quality-of-service guarantees, resource reservation, traffic specification, shaping, and monitoring, admission control; Multicasting issues; Session directories; Protocols for controlling sessions; Security issues in multimedia â€“ digital water-marking, partial encryption schemes for video streams; Multimedia applications - audio and video conferencing, video on demand, voice over IP.', '', ''),
('CSE461', 'Undergraduate', 'Algorithm Engineering', 3, 4, 2, 'Computational complexity, Parameterized complexity, Algorithms for combinatorial optimization, practical computing and heuristics, Approximation algorithms, LP based approximation algorithms, randomized algorithms, Experimental algorithmic, Algorithms in state-of-the-art fields like Bioinformatics, Grid Computing, VLSI design etc.', 'CSE207', ''),
('CSE462', 'Undergraduate', 'Algorithm Engineering Sessional', 0.75, 4, 2, 'Laboratory works based on CSE 461.', '', ''),
('CSE463', 'Undergraduate', 'Computational Geometry', 3, 4, 2, 'Algorithm and complexity of fundamental geometric objects: polygon triangulations and art gallery theorem, polygon partitioning, convex hulls in 2-dimension.\r\n<br>\r\nProximity: Voronoi diagrams and Delaunary triangulations.\r\nGraph Drawing: drawing styles and applications, drawing of rooted trees, straight line drawing of planar graphs.', 'CSE207', ''),
('CSE464', 'Undergraduate', 'Computational Geometry Sessional', 0.75, 4, 2, 'Laboratory works based on CSE 463.', '', ''),
('CSE471', 'Undergraduate', 'Machine Learning', 3, 4, 2, 'Introduction to machine learning; Learning algorithms: supervised, unsupervised, reinforcement, attribute based, neural network based, relational supervised and negative correlation; Genetic algorithm, genetic programming and evolutionary programming; Practical application of machine learning. ', 'CSE401', ''),
('CSE472', 'Undergraduate', 'Machine Learning Sessional', 0.75, 4, 2, 'Laboratory works based on CSE 471.', '', ''),
('CSE473', 'Undergraduate', 'Pattern Recognition', 3, 4, 2, 'Pattern Recognition: introduction, importance; Statistical and Neural Pattern Recognition: Bayesian classifier, Bayes decision theory, discriminant functions and decision surfaces; Bayesian classifier for normal distributions; Linear classifiers: discriminant functions and decision hyperplanes, Perceptron algorithm and its variants, Kesslerâ€™s construction; Nonlinear classifiers: two and three layer perceptrons, backpropagation algorithm and its variants; Template matching: optimal path searching techniques, dynamic programming methods, correlation based matching and 2D log search algorithm for image matching; Context dependent classification: Viterbi algorithm, channel equalization, observable and hidden Markov models, three problems of HMM and their application in speech recognition; Syntactic Pattern Recognition: introduction to Syntactic Pattern Recognition, grammar-based approach, parsing, graph-based approach; Unsupervised classification: basic concepts of clustering, proximity measures, categories of clustering algorithms, sequential clustering algorithms. ', '', ''),
('CSE474', 'Undergraduate', 'Pattern Recognition Sessional', 0.75, 4, 2, 'Introduction to MATLAB; Laboratory works based on CSE 473 and using MATLAB: Bayesian classifier, linear classifier, nonlinear classifier, image matching, speech recognition, context dependent classification.', '', ''),
('CSE481', 'Undergraduate', 'VLSI Design', 3, 4, 2, 'VLSI design methodology: top-down design approach, technology trends and design automation algorithms; Introduction to CMOS inverters and basic gates; Brief overview of CMOS fabrication process: layout and design rules; Basic CMOS circuit characteristics and performance estimation; Buffer circuit design; Complex CMOS gates, CMOS building blocks: adder, multiplier; data path and memory structures.\r\n<br>\r\nHardware modeling: hardware modeling languages, logic networks, state diagrams, data-flow and sequencing graphs, behavioral optimization.\r\n<br>\r\nArchitectural Synthesis: circuit specification, strategies for architectural optimization, data-path synthesis, control unit synthesis and synthesis of pipelined circuits.\r\n<br>\r\nASIC design using FPGA and PLDs.', '', ''),
('CSE482', 'Undergraduate', 'VLSI Design Sessional', 0.75, 4, 2, 'Laboratory works based on CSE 481.', '', ''),
('CSE483', 'Undergraduate', 'Computer Interfacing', 3, 4, 2, 'Interfacing with floppy and hard-disk controller; serial communication interface; Barcode reader; Sound card; MIDI interface; Printer interface; ISA, PCI, AGP, PS/2 and USB interfaces; Interfacing with stepper motors, controlling semiconductor power switches â€“ BJT, MOSFET, SCR and Triac, Application of Opto-coupler and relays, Embedded Processors, Embedded Computing Platform, Real Time Embedded Systems, Real Time Operating Systems, Embedded Systems Programming, Mapping between languages and hardware, Embedded Communication Systems, Embedded Computer Security.', 'CSE315', ''),
('CSE484', 'Undergraduate', 'Computer Interfacing Sessional', 0.75, 4, 2, 'Laboratory works based on CSE 483.', '', ''),
('CSE6000', 'Graduate', 'Thesis/Project', 0, 0, 0, '<table border="1" align="center">\r\n<tr>\r\n<th align="center">Name of Degree</th>\r\n<th align="center">Course Type</th>\r\n<th align="center">Credit Hours</th>\r\n</tr>\r\n<tr>\r\n<td align="center">Ph.D.</td>\r\n<td align="center">Thesis</td>\r\n<td align="center">45</td>\r\n</tr>\r\n<tr>\r\n<td align="center">M.Sc.Engg.</td>\r\n<td align="center">Thesis</td>\r\n<td align="center">18</td>\r\n</tr>\r\n<tr>\r\n<td align="center">M.Engg.</td>\r\n<td align="center">Project</td>\r\n<td align="center">6</td>\r\n</tr>\r\n</table>', '', ''),
('CSE6102', 'Graduate', 'Computer Arithmetic', 3, 0, 0, 'Integer arithmetic, Floating point arithmetic; Single precision and double precision; Interrupt handling high-speed adders; Standard and recorded multipliers, Booth''s multiplier, Canonical and multi bit scanning multipliers, Array multipliers; High radix non-restoring division, SKT division, Robertson division, Convergence division and cellular array dividers; Floating point processors; Binary squares and square roots, evaluation of trigonometric Functions and polynomials, Chen convergence Computation, CORD1C computations, Logarithmic number system (LNS) processor.', '', ''),
('CSE6103', 'Graduate', 'Advanced Logic Design', 3, 0, 0, 'Functional decomposition and Symmetric functions; Linear sequential machines; Reed-Muller expansions and their minimizations; Exor based logic design; self-timed circuits; asynchronous design techniques; Digital logic circuit testing and testable design: testing of combinational and sequential logic circuits, design for testability and built-in self test; Digital logic simulation.', NULL, NULL),
('CSE6205', 'Graduate', 'Computer Organization and Design', 3, 0, 0, 'Classification and addressing modes, Operands and Operations for Media and signal processing, instructions for control flow, Encoding an instruction set. Pipelined and Superscalar processors, Data hazards, Dynamic scheduling, Branch prediction, Hardware based speculation, Thread level parallelism. ILP with software approaches: Compiler Techniques, static branch prediction, static multiple issue, advanced compiler support for ILP. Basic Techniques of Integer Arithmetic, Floating-point Arithmetic, Speeding up Integer Addition, Speeding up Integer Multiplication and Division. Memory technology, RAIDs, organization for improving performance, Virtual memory and protection, Cache organization, Reducing cache miss rate and penalty. Busses, Performance measures, Designing I/O system, Reliability, Dependability and Availability. Symmetric shared memory architectures, Cache coherence protocols, Distributed shared memory architectures, Synchronization, Models for memory consistency, Multithreading. Interconnection Networks- Practical issues, Network on chip, Designing cluster. Advanced RISC, CISC and Embedded processors architectures.', '', ''),
('CSE6206', 'Graduate', 'Advanced Microprocessor', 3, 0, 0, 'Review of different microprocessors: 80486, 68040, V70, Gmicro processors; Comparing the architectures: RISC and CISC; Instruction set of machines: SPARC, INTEL, and MIPS; Study of microprocessors: Pentium II, Alpha 21064, MIS 6400, PA-RISC; Math coprocessors and microprocessors.', NULL, NULL),
('CSE6301', 'Graduate', 'Software Project Management', 3, 0, 0, 'Foundations of software project management; organization structure and staffing; motivation, authority and influence; conflict management; proposal preparation; a large engineering software system management; client management; managing software project teams; project planning and scheduling; risk management; configuration management; pricing estimation and cost control; quality assurance and accreditation; factors affecting software quality; software quality assurance plans; business context and legal issues for software projects; software measurement: testing, upgrading and maintenance; network systems; and international project management.', '', ''),
('CSE6302', 'Graduate', 'Software Quality Assurance', 3, 0, 0, 'Definition and concept of software quality assurance (SQA); quality models; specification of quality requirements; product development & delivery issues; software development processes & maturity; software quality management process: total quality management, improvement cycle, SQA planning & management, organizing the SQA effort; software verification & validation; typical software development errors; Fagan inspections; software audit; software testing: testing objectives & testing fundamentals, testing theory, coverage criteria, equivalence class testing, value-based testing, decision table, syntax & state transition testing, statement & path testing, branch & condition testing, data flow testing, thread-based testing, integration & integration testing, system testing; testing in object-oriented systems; test tools & test automation; test management; problem reporting & corrective action.', '', ''),
('CSE6303', 'Graduate', 'Information System Management', 3, 0, 0, 'Information systems management: importance of information systems (IS) management, IS management''s leadership role, strategic uses of IT, IS planning; managing essential technologies: distributed systems, managing telecommunications, managing information resources, and managing operations; managing system development: technologies for developing systems and management issues in system development; systems for supporting knowledge work: supporting decision making, collaboration, and knowledge works; acquisition of hardware, software, networks, and services: request for proposal, acquisition methods (buy, rent, or lease), software acquisition, and analysis of alternatives; people and technology: the challenges ahead.', '', ''),
('CSE6304', 'Graduate', 'Software Testing', 3, 0, 0, 'Objectives of software testing, test process, testing and development, test case, test execution, test harness, testing and debugging, test adequacy, control flow graph, errors, faults and failures, types of testing; Test generation from requirements: equivalence partitioning, boundary value analysis, category partitioning, fault model for predicates, Boolean operator (BOR), Boolean and relational operator (BRO), and Boolean and relational expression (BRE) methods, limitations of test generation from requirements; Test adequacy assessment: adequacy criteria, control flow based criteria, data flow based criteria, mutation based criteria, adequacy as a stopping criterion, adequacy as a tool for test enhancement; GUI testing, security testing, random testing, combinatorial testing; Testing tools: Open source and commercial software testing tools.', '', ''),
('CSE6305', 'Graduate', 'Programming Languages and Systems', 3, 0, 0, 'Modern programming languages; Object oriented programming systems; Runtime virtual machines: How virtual machine works, Different classes of virtual machines, Jikes research virtual machine; Compilation techniques: Interpreter and baseline compilation, Just-in-time compilation and dynamic optimization; Type systems: Strong and weak type systems, Static and dynamic type checking; Concurrency and synchronization: Atomic operations, Thin locks and lock free design; Memory model; Thread scheduling; Dynamic memory allocation: Free-list, contiguous and region based allocation, Fast parallel memory allocation; Garbage collection: Fundamental garbage collection algorithms, Stop-the-world, parallel and concurrent garbage collection, State of the art garbage collectors; Performance analysis and benchmarking.', '', ''),
('CSE6401', 'Graduate', 'Parallel Algorithms', 3, 0, 0, 'Introduction, Parallel processing, Parallel models, Performance of Parallel Algorithms, The work-time presentation framework, Basic techniques: Pointer jumping, Balanced trees, Divide and Conquer, Pipelining, Partitioning and symmetry breaking, List ranking, Euler-Tour technique, Tree contraction; Parallel searching, merging, sorting and selection, Connected components, Minimum spanning trees, Biconnected Components, Directed graphs, Plane sweeping, Visibility problems, Simulation between PRAM models, Lower hounds for EREW, CREW and CRCW PRAMs.', NULL, NULL),
('CSE6402', 'Graduate', 'Graph Theory', 3, 0, 0, 'Introduction, Fundamental concepts, Trees, Spanning trees in graphs, Distance in graphs, Eulerian graphs, Digraphs, Matching and factors, Cuts and connectivity, k-connected graphs, Network flow problems, Graph coloring: vertex coloring and edge coloring, Line graphs, Hamiltonian cycles, Planar graphs, Perfect graphs.', NULL, NULL),
('CSE6403', 'Graduate', 'Computational Geometry', 3, 0, 0, 'Searching and Geometric Data Structures: Balanced binary search trees, Priority-search trees, Range searching, Interval trees, Segment trees, Algorithms and complexity of fundamental geometric objects: Polygon triangulation and art gallery theorem, Polygon partitioning, Convex-hulls in 2-dimension and 3-dimension, Dynamic convex-hulls; Geometric intersection: Line segment intersection and the plane-sweep algorithm, Intersection of polygons; Proximity: Voronoi diagrams, Delunay triangulations, closest and furthest pair; Visualization: Hidden surface removal and binary space partition (BSP) trees; Graph Drawings: Drawings of rooted trees (Layering, Radial drawings, HV-Drawings, Recursive winding), Drawings of planar graphs (Straight-line drawings, Orthogonal drawings, Visibility drawings); Survey of recent developments in computational geometry.', NULL, NULL),
('CSE6404', 'Graduate', 'VLSI Layout Algorithms', 3, 0, 0, 'VLSI design cycle, physical design cycle, design styles; Basic graph algorithms and computational geometry algorithms related to VLSI layout; Partitioning algorithms: group migration algorithms, simulated annealing and evaluation, performance driven partitioning; Floor planning and placement algorithms: constraint based floor planning, rectangular dualization and rectangular drawings, integer programming based floor planning, simulation based placement algorithms, partitioning based placement algorithms; Pin assignment algorithms; Routing algorithms: maze routing algorithms, line prob algorithms, shortest-path based and steiner tree based algorithms, river routing algorithms, orthogonal drawing based algorithms; Compaction algorithms: constraint-graph based compaction, virtual grid based compaction, hierarchical compaction; Algorithms for Multi-Chip Module (MCM) physical design automation.', NULL, NULL),
('CSE6405', 'Graduate', 'Graph Drawing', 0, 0, 0, 'Introduction to graph drawing: historical background of graph drawing, drawing styles, properties of drawings, applications  of graph drawing; Graph theoretic foundations;  Straight line drawing: shift method, realizer method, compact grid drawing;  Convex drawing: convex drawing and convex testing, convex grid drawing; Rectangular drawing: rectangular drawing and matching, Thomassen''s theorem, linear algorithms for rectangular drawing; Box-rectangular drawing; Orthogonal drawing: orthogonal drawing and network flow, linear algorithms for orthogonal drawing; Octagonal drawing; Tree drawing.', '', ''),
('CSE6406', 'Graduate', 'Bioinformatics Algorithms', 3, 0, 0, 'Introduction; <i>Molecular biology basics</i>: DNA, RNA, genes, and proteins; Restriction mapping algorithm; Motif in DNA sequences, motif finding algorithms; Genome rearrangements, sorting by reversals and breakpoints; DNA sequence alignments; Gene prediction; Space-efficient sequence alignments, sub-quadratic alignment; DNA sequencing, genome sequencing, protein sequencing, spectrum graphs; <i>Combinatorial pattern matching</i>: Exact pattern matching, heuristic similarity search algorithms, approximate string matching, BLAST, FASTA; <i>Clustering</i>: Microarrays, hierarchical clustering, K-means clustering, corrupted cliques problem, CAST clustering algorithm; Evolutionary trees.', '', ''),
('CSE6407', 'Graduate', 'Combinatorial Optimization', 3, 0, 0, 'Introduction to Optimization; Linear Programming: Different forms, Simplex Method, Primal-Dual theory; Max-Flow: The Max-Flow-Min-Cut Theorem, Ford-Fulkerson Labeling Algorithm, Dijkstra''s Algorithm, The Floyd-Warshall Algorithm; Some Network Flow Algorithms: The Minimum Cost Network Flow Method, Transportation Problem; Capacitated Transportation Problem, Assignment Problem; Integer Linear Programming; Relaxation; Cutting-Plane Algorithm; Branch and Bound Technique; Dynamic Programming; NP-Completeness; TSP and Heuristics; Approximation.', '', ''),
('CSE6408', 'Graduate', 'Advanced Algorithms', 3, 0, 0, 'Randomized Algorithms: Las Vegas and Monte Carlo Algorithms; Randomized Data Structures: Skip Lists; Amortized Analysis: Different methods, Applications in Fibonacci Heaps; Lower Bounds: Decision Trees, Information Theoretic Lower Bounds, Adversary Arguments; Approximation Algorithms: Approximation Schemes, Hardness of Approximation; Fixed Parameter Tractability: Parameterized Complexity, Techniques of designing Fixed Parameter Algorithms, Examples; Online Algorithms: Competitive Analysis, Online Paging Problem, k-server Problem; External Memory Algorithms; Advanced Data Structures: Linear and Non-linear Methods', '', ''),
('CSE6409', 'Graduate', 'Stringology', 3, 0, 0, 'Introduction to Stringology: Notations, Problems and Naive Solutions, Motivations, Applications, Basic string searching algorithms; Data structures for String Matching: Suffix Tree, Suffix Array, Aho-Corasick Automaton, Applications of these data structures; Approximate Pattern Matching: Edit distance, Dynamic programming, Similarity measures for DNA and protein sequences, q-gram methods, Bit-parallel methods, Algorithms for degenerate/indeterminate strings; Sequence Analysis: Longest Common subsequence (LCS) Problem, Advanced Algorithms for LCS, Variants of LCS and algorithms; Text Compression: Shannon-Fano and Huffman codes, Arithmetic coding, Lempel-Ziv family of compression techniques, Burrows-Wheeler Transformation. ', '', ''),
('CSE6410', 'Graduate', 'Advanced Algorithmic Graph Theory', 3, 0, 0, ' Vertex Orderings: st-Numbering and Canonical Orderings; Graph Decompositions and Their Algorithmic Applications: Ear\r\n Decomposition, Canonical Decomposition, Tree Decomposition, Path\r\n Width and Tree Width, PQ-tree, SPQR-tree, Split Decomposition, Recursively\r\n Decomposable Graphs, Clique Separator Decomposition;\r\n Graph Representations: Implicit Representations, Intersection and\r\n Containment Representations;\r\n Graph Classes Defined by Forbidden Subgraphs;\r\n Graph Classes Defined by Elimination Schemes;\r\n Classes of Graphs with Bounded Treewidth and Their Algorithmic\r\n Implications;\r\n Characterization, Construction and Recognition Algorithms for Some\r\n Special Classes of Graphs.', '', ''),
('CSE6501', 'Graduate', 'Advanced Artificial Intelligence', 3, 0, 0, 'Introduction, Advanced search techniques in AI, Knowledge based system design, Advanced plan generating systems, Bayesian network and probabilistic reasoning, Learning in neural belief networks, Practical natural language processing, Computer vision, Introduction to Robotics.', NULL, NULL),
('CSE6502', 'Graduate', 'Symbolic Machine Learning-I', 3, 0, 0, 'Introduction, Supervised and Unsupervised learning in prepositional logic, Induction of decision trees, Noise and over-fitting issues, Minimum description length principle, Conceptual clustering, Version space, Nearest neighbor classifier, Genetic algorithm, Computational learning theory, Neural network and Fuzzy logic.', NULL, NULL),
('CSE6503', 'Graduate', 'Symbolic Machine Learning-II', 3, 0, 0, 'Introduction, Learning in First order logic, Top-down and Bottom-up approaches for inducing first order theory, Handling noise, First order theory revision, Predicate invention, Application of Inductive Logic Programming, Multiple predicate learning, Different types of language bias, PAC Learnability, knowledge discovery in database and data mining, Text and image retrieval.', NULL, NULL),
('CSE6504', 'Graduate', 'Advanced Syntactic Pattern Recognition', 3, 0, 0, 'Introduction to formal languages, String languages for pattern description, Higher dimensional pattern grammars, Syntax analysis as a recognition procedure, Stochastic languages, Error-correcting parsing for string languages, Error-correcting tree automata, Cluster analysis for syntactic patterns, Grammatical inference for syntactic pattern recognition, Application shape analysis of wave forms and contours, Syntactic approach to texture analysis.', NULL, NULL),
('CSE6505', 'Graduate', 'Speech Recognition', 3, 0, 0, 'Introduction, Speech signal: production, perception and characterization, Signal processing and analysis; Pattern comparison techniques: distortion measures, spectral-distortion measures, time alignment and normalization; Recognition system design and implementation: source-coding, template training, performance analysis; Connected word models: two level DP, level building algorithm, one-pass algorithm; Continuous speech recognition: sub word units, statistical modeling, context-dependent units; Task oriented models.', NULL, NULL),
('CSE6506', 'Graduate', 'Data Mining', 3, 0, 0, 'Introduction; Data warehousing and OLAP technology for data mining; Data preprocessing; Data mining primitives, languages and systems; Descriptive data mining: characterization and comparison; Association analysis; Classification and prediction; Cluster analysis; Mining complex types of data; Applications and trends in data mining. ', NULL, NULL),
('CSE6507', 'Graduate', 'Machine Translation', 3, 0, 0, 'Theoretical problems: Definition, Context dependency, interpretation and translation; Engineering problems of machine translation: Maintainability, tunability, modularity, and efficiency; Linguistics-based MT: Compositionality and isomorphism, Declarative frameworks, Constraint-based formalisms; Knowledge-based MT: Translation and understanding, Design of interlinguas, The conceptual lexicon; Statistics-based MT: E-M algorithms, Alignment of bilingual corpora, Translation templates; Example-based MT: Similarity measures, Levels of comparison; Treatment of context dependency: Knowledge-based transfer, Sublanguage-based MT, Translation units.', NULL, NULL),
('CSE6508', 'Graduate', 'Evolutionary Algorithms', 3, 0, 0, 'Introduction to evolutionary algorithm; Selection: rank-based, roulette wheel, stochastic, local, truncation and tournament; Recombination: discrete, real valued and binary valued; Mutation: real valued and binary valued; Reinsertion: global and local; Population models: global- worker/farmer, local â€“ diffusion, and regional â€“ migration; Co-evolution: cooperative and competitive; Learnable evolution model; Fast evolutionary programming; Application of evolutionary algorithms to: system design, telecommunication, robotics and other industrial areas.', '', ''),
('CSE6509', 'Graduate', 'Text-to-Speech Synthesis', 3, 0, 0, 'Introduction and definition, composition and production of speech; Human hearing, acoustics and phonetics; <i>Text parsing and processing</i>: Grammars and lexicons, segmentation, transducers; Morphological and contextual analysis; <i>Phonetization</i>: phonemes, modules and systems; <i>Intonation and prosody</i>: levels, acoustic, perceptual and linguistic models, prosodic parsing; <i>Techniques</i>: architectures, formalisms, databases, rule based, formant, concatenative, linear predictive, and stochastic synthesis.', '', ''),
('CSE6601', 'Graduate', 'Advanced Database Systems', 3, 0, 0, 'Object Oriented Database; Data Model, Design, Languages; Object Relational Database: Complex data types, Querying with complex data types, Design; Distributed Database: Levels of distribution transparency, Translation of global queries to fragment queries, Optimization of access strategies, Management of distributed transactions, Concurrency control, Reliability, Administration; Parallel Database: Different types of parallelism, Design of parallel database; Multimedia Database SystemsBasic concepts, Design, Optimization of access strategies, Management of Multimedia Database Systems, Reliability; Database Wire-housing/Data mining: Basic Concepts and algorithms.', NULL, NULL),
('CSE6602', 'Graduate', 'High Dimensional Data Management', 3, 0, 0, 'Spatial database systems; spatial data types; indexing and querying spatial data; spatial networks; temporal database systems; moving object data management systems; moving object indexing techniques; query processing on moving object data; multidimensional indexing methods; similarity search; dimension reduction methods; time series data; indexing techniques for massive time series data; state-of-the-art systems for managing high dimensional data;  emerging issues in high-dimensional data management systems.', '', ''),
('CSE6701', 'Graduate', 'Neural Networks', 3, 0, 0, 'Fundamentals of Neural Networks; Back propagation and related training algorithms; Hebbian learning; Cohonen-Grossberg learning; The BAM and the Hopfield Memory; Simulated Annealing; Different types of Neural Networks: Counter propagation, Probabilistic, Radial Basis Function, Generalized Regression, etc; Adaptive Resonance Theory; Dynamic Systems and neural Control; The Boltzmann Machine; Self-organizing Maps; Spatiotemporal Pattern Classification, The Neocognition; Practical Aspects of Neural Networks. ', NULL, NULL),
('CSE6702', 'Graduate', 'Mathematical Programming', 3, 0, 0, 'Basic concept of Mathematical Programming, Concepts of linear and quadratic programming, Convexity, Convex sets and convex functions, Concept of integer programming, Some examples of integer programming problems, Linear programming techniques, Graphical solution of linear programming problems, Simplex method, Dual simplex method, Different integer programming techniques, Revised simplex method.', NULL, NULL),
('CSE6703', 'Graduate', 'Petri Net Theory and Modeling of Systems', 3, 0, 0, 'Definition and types of Petri nets, Terms and notations marking, Importance of net theory, Transition firings, Practical modeling examples, Siphons and traps, Live ness and safeness, Behavioral properties, Deadlocks and siphons, Structural properties, Stochastic Petri Net (SPN).', NULL, NULL),
('CSE6704', 'Graduate', 'Fuzzy Systems', 3, 0, 0, 'Basic Concepts of Fuzzy set theory; Fuzzy numbers; Aggregation operations of Fuzzy sets; The theory of approximate reasoning; Introduction to Fuzzy logic control; Fuzzy System Models and Developments; Fuzzy logic controllers; Defuzzification methods; Linguistic descriptions and their analytical forms; The flexible structure of fuzzy systems; Practical Aspects of Neural Networks.', NULL, NULL),
('CSE6705', 'Graduate', 'Meta-Heuristics', 3, 0, 0, 'Heuristics and meta-heuristic: notation, motivations, applications; Representations: vectors, graphs, trees, lists, rulesets; Single-state methods: hill-climbing, global optimization algorithms, simulated annealing, tabu search, iterated local search, guided local search, reactive local search, greedy randomized adaptive search procedures; Nature inspired methods: evolution strategies, genetic algorithms, particle swarm optimization, ant colony optimization, bee colony optimization, artificial immune systems; Hybrid methods; Parallel methods: multiple threads, island models, master-slave fitness assessment, spatially embedded models; Multiobjective optimization; Performance evaluation.', '', '');
