('CSE6706', 'Graduate', 'Advanced Digital Image Processing', 3, 0, 0, 'Image sampling and quantization; Image smoothing , sharpening and contrast enhancement in spatial and frequency domains: basic gray level transformation, histogram processing, image subtraction, image averaging, Gaussian and Laplacian filters in spatial and frequency domains, convolution theorem; Image de-noising:  noise models, noise reduction by spatial and frequency domain filters, mean filter, adaptive filter, bandpass and band reject filters, notch filter, inverse filter, minimum mean square error filter; Multi-resolution image processing: wavelet transform in one and two dimensions, tree structured wavelet transform, pyramid structured wavelet transform, curvelet transform; Morphological image processing: erosion, dilation, opening, closing, hole filling, connected components, thinning, skeletons, extension of morphological operations to gray scale images; Image segmentation: thresholding, region based segmentation, contour based segmentation, graph based segmentation; Color image processing: color models and transformations, edge detection and segmentation in color images, color image compression; Digital image security; Image content feature extraction, representation and image retrieval; Concept learning and object recognition.', '', ''),
('CSE6707', 'Graduate', 'Image Retrieval', 3, 0, 0, 'Color models and their properties; Color feature extraction: color histogram, color coherence vector, color correlogram, dominant color descriptor, scalable color descriptor, color structure descriptor, color naming system; Texture feature extraction: moment based texture features, gray level co-occurrence matrix, features based on Gabor filter, wavelet and curvelet transforms, simultaneous autoregressive model, fractal dimension, edge detection and edge histogram; Shape feature extraction: image segmentation, contour representation by chain codes, Fourier descriptors, and curvature scale space, region descriptors; local and global features; Distance measures; Performance metrics; Databases; Tradition metadata based image retrieval; Content based image retrieval (CBIR) using low level color, texture and shape features; Issues in CBIR; Relevance feedback in image retrieval; Image understanding using support vector machines, neural networks, decision tree, Bayesian theorem, and ontology; Semantic image retrieval; Web image retrieval.', '', ''),
('CSE6708', 'Graduate', 'Semantic Web', 3, 0, 0, 'Semantic web: general overview, motivation, models, technologies; Data representation: traditional data-modeling methods, semantic relationships; Resource Description Framework (RDF): syntax, data structures, formal semantics (RDFS); Web Ontology Language (OWL): semantics, standards, logic, expressivity,\r\nreasoning; Logic and inference: monotonic rules, facts and goals, OWL2 RL (Rule Language), Rule\r\n Interchange Format (RIF), Semantic Web Rules Language (SWRL); Ontology: formats, rules, queries,\r\nSimple Protocol and RDF Query Language (SPARQL); Ontology engineering: ontology construction, reuse\r\nand acquisition, ontology mapping; Semantic web applications and application architecture; Semantic web \r\ntools.', NULL, NULL),
('CSE6801', 'Graduate', 'Distributed Computing Systems', 3, 0, 0, 'Distributed object systems, Retrieving and caching of distributed information, Distributed data replication and sharing, Performance issues, Algorithms for deadlock detection, Concurrency control and synchronization in distributed system, Models for distributed computation, Networking facilities and resource control and management methods in network and distributed operating systems, Collaborative applications, Wide area network computing, Web based commerce, Agent systems and Market based computing.', NULL, NULL),
('CSE6802', 'Graduate', 'Multimedia Systems', 3, 0, 0, 'Overview to Multimedia Systems, Multimedia storage, Data compression techniques for audio and video, Synchronization, Multimedia networking and protocols, QOS principles, Video streams on ATM, Mobile multimedia communications, Operating system support for multimedia, Hypermedia system, Standards for multimedia, Multimedia database and Multimedia Applications.', NULL, NULL),
('CSE6803', 'Graduate', 'Computer Graphics and Animation', 3, 0, 0, 'Advanced Graphic Techniques: Graphics basics, Three dimensional drawings, Geometric forms and models, Hidden surfaces, Fractals; Advanced rendering Techniques: Shadow generation techniques, Texture and environment mapping techniques, Procedural texture mapping and modeling, Ray tracing, Radiosity methods, Global illumination models, Volume rendering techniques; Advanced Animation: Animation articulated structures, Soft object animation, Procedural animation.', NULL, NULL),
('CSE6804', 'Graduate', 'Computer Communications and Networks-I', 3, 0, 0, 'Network security- Authentication protocols and Digital signatures, email privacy; Modifications of TCP; TCP over ATM; ATM internetworking; ATM service categories and quality of services; ATM switch architectures and their performance; Digital switching; Traffic analysis; Fiber optics networks – optical packet switching; Metropolitan networks, Wide area networking, Gigabit Ethernet, ADSL.', NULL, NULL),
('CSE6805', 'Graduate', 'Computer Communications and Networks-II', 3, 0, 0, 'HTTP, pHTTP and recent advances in internet protocols; Web server performance, proxy servers, load balancing in web servers; IP switching: Tag switching, Multi-protocol label switching; IP security; Queuing models for networks and protocols; Real time protocols: RTP, RTCP, RTSP; Voice over IP; Distributed object technology for networking; Networks agents; Active networks and protocol boosters, Multimedia Networking: Integrated Service, Differential Service, MPLS.', NULL, NULL),
('CSE6806', 'Graduate', 'Wireless and Mobile Communication Networks', 3, 0, 0, 'Characteristics of cellular communications; QOS in cellular communications; Wireless LAN; Wireless ATM and media access protocols for WATM; Wireless application protocols; Wireless personal communications; Mobile IP; Spread spectrum techniques: DSSS, FHSS, CDMA, GSM, CPDP; satellite communications – internetworking via satellites; Mobile satellite communications.', NULL, NULL),
('CSE6807', 'Graduate', 'Elements of Cryptography', 3, 0, 0, 'Classical Cryptography: Introduction to simple cryptosystems, Cryptanalysis; Shannon''s Theory: Perfect secrecy, Entropy, Product cryptosystems; Data Encryption Standard: Description of DES, Differential cryptanalysis; RSA System and Factoring: Public-key cryptography, RSA cryptosystem, Attacks on RSA, Factroing algorithms; Other Public-key cryptosystems: ElGamal cryptosystem and discrete logs, Merkle-Hellman Knapsack System; Signature Schemes: ElGamal signature schemes, Digital signature standard, Fail-stop signatures; Hash Functions: Signatures and Hash functions, Collision-free Hash functions, Birthday attack; Key Distribution and Key Agreement: Key predistribution, Kerboros, Diffie-Hellman key exchange; Identification Schemes: Schnorr identification scheme, Okamoto identification schemes; Authentication Codes: Computing deception probabilities, Combinatorial bounds, Entropy bounds; Secret Sharing Schemes: Shamir threshold scheme, Access structure and general secret sharing; Pseudo-random Number Generation: Indistinguishable probability distribution, probabilistic encryption; Zero-knowledge proofs: Interactive proof systems, computational Zero-knowledge proofs.', '', ''),
('CSE6808', 'Graduate', 'Wireless Resource Management', 3, 0, 0, 'Resource management architecture: evolution and components of QoS and cross-layer architecture for bandwidth management; tri-band and smart antenna; handoff management; mobility prediction; resource management and connection admission control; bandwidth allocation and scheduling: real-time guaranteed and fair real-time scheduling; inter-domain radio resource management; high performance broadband architecture; wireless truthful computing; resource allocation of spatio-temporal division multiple access control; resource management schemes for connectivity: Piconet and scatternet; energy efficient MAC layer protocols for wireless ad-hoc networks; routing and resource discovery for wireless ad-hoc networks: QoS based routing, topology management, efficient resource discovery, hybrid routing protocols, and localization; energy efficient broadcasting and multicasting algorithms; power-conserving broadcasting and multicasting algorithms; scopes of increasing wireless resources, research and future developments. ', '', ''),
('CSE6809', 'Graduate', 'Distributed Search Techniques', 3, 0, 0, 'Large-scale distributed systems: properties and examples; search requirements in service discovery, peer-to-peer content sharing and distributed XML databases; unstructured techniques: intelligent flooding, hint-based routing, etc.; basic structured techniques: Chord, CAN, Tapestry, Kademlia, etc.; advanced structured techniques: pSearch, Squid, SkipNet, etc.; Signature search techniques using Bloom filters; Distributed Pattern Matching (DPM) problem and its applications; distributed crawling and indexing techniques.', '', ''),
('CSE6810', 'Graduate', 'Multimedia Encoding', 3, 0, 0, 'Introduction; Multimedia data: image, audio, and video; Image encoding: Transform coding, vector quantization, and Fractal encoding; Image encoding standards; Audio encoding: Liner predictive coding, filter bank design, psychoacoustic models, Code Excited Linear Prediction (CELP), Algebraic CELP, Regular Pulse Excitation, Multi Pulse Excitation, and Vector-sum Excited Linear Prediction ; Audio encoding standards; Video encoding: motion prediction (full search, Â½ pel and Â¼ pel precision), and Fine-granular scalable encoding (Bit-plane encoding); Video encoding standards; Video file formats; Video storage mediums; Audio-video Channel coding.', '', ''),
('CSE6811', 'Graduate', 'Wireless Ad Hoc Networks', 3, 0, 0, 'Introduction: applications and motivations; broadcasting protocols: algorithmic aspect, optimization techniques, power-efficient broadcasting;, routing protocols: DSDV, AODV, DSR, position based routing protocols, load balancing techniques, multi-path routing; medium access control protocols: reservation-based MAC protocols, Bluetooth technology, IEEE 802.11 based MAC protocols; channel propagation models; topology control protocols; power aware protocol design; cross layer design principles; mobility awareness; fairness and security issues: attacks and preventions; stimulating cooperation: self policing schemes, economic incentive based schemes; other state-of-the-art relevant topics.', '', ''),
('CSE6812', 'Graduate', 'Wireless Sensor Networks', 3, 0, 0, 'Introduction: applications; Localization and tracking: tracking multiple objects; Medium Access Control: S-MAC, IEEE 802.15.4 and ZigBee; Geographic and energy-aware routing; Attribute-Based Routing: directed diffusion, rumor routing, geographic hash tables; Infrastructure establishment: topology control, clustering, time synchronization; Sensor tasking and control: task-driven sensing, information-based sensor tasking, joint routing and information aggregation; Sensor network databases: challenges, querying the physical environment, in-network aggregation, data indices and range queries, distributed hierarchical aggregation; Sensor network platforms and tools: sensor node hardware, sensor network programming challenges; Other state-of-the-art related topics.', '', ''),
('CSE6813', 'Graduate', 'Network Security', 3, 0, 0, 'Network security policies, strategies and guidelines; Network security assessments and matrices; Different attacks: Denial of Service attack (DoS), Distributed Denial of Service (DDoS) attack, Eavesdropping, IP spoofing, Sybil attack, Blackhole attack, Grayhole attack, Man-in-the-middle attack, Passwords-based offline attacks; Network security  threats and attackers: Intruders, Malicious software, Viruses and Spy-ware; Security standards: DES, RSA, DHA, Digital Signature Algorithm (DSA), SHA, AES; Security at Transport layer: Secure Socket Layer (SSL) and Transport Layer Security (TLS); Security on Network layer: IPSec; Network security applications: AAA standards, e-mail securities, PGP, S/MIME; PKI smart cards; Sandboxing; Firewalls and Proxy server; Security for wireless network protocols: WEP, WPA, TKIP, EAP, LEAP; Security protocols for Ad-hoc network; Security protocols for Sensor network; Security for communication protocols; Security for operating system and mobile agents; Security for e-commerce; Security for LAN and WAN; Switching and routing security; Other state-of-the-art related topics.', '', ''),
('CSE6900', 'Graduate', 'Special Topics Related to Computer Science and Engineering', 3, 0, 0, 'Syllabus should be approved by BPGS prior to the commencement of the term. In each term only one such course title under this course number can be offered. Furthermore one student can take such course only once.', NULL, NULL),
('CSE_CSE451', 'Undergraduate', 'Data Communication-II', 3, 4, 2, 'Synchronous and asynchronous communications; Hardware interfaces, multiplexers, concentrators and buffers; Communication mediums and their characteristics; Data communication services: SMDS and ATM; Error control codes: linear block codes, cyclic codes, MLDC codes, convolution codes, Trellis code modulation;  Digital switching: space and time division switching; Radio system design; Fiber optics communication: transmitter, receivers, network components, WDM; Line coding, trunks, multiplexing, switching, ATM switches; Satellite communications: frequency bands and characteristics, types of satellites, transmission impairments, capacity allocation; Multiple access techniques.', 'CSE311', ''),
