('CSE_CSE453', 'Undergraduate', 'Wireless Networks', 3, 4, 2, 'Cellular concepts: frequency reuse, handoff strategies, interference and system capacity, grade of service, improving capacity and coverage, call blocking probability; Propagation effects: outdoor propagation models, indoor propagation models, power control, Dopplerâ€™s effect, small and large scale fades; Wireless LAN Technology; IEEE 802.11: standard, protocol architecture, physical layer and media access control; Mobile IP; Wireless Application Protocol; IEEE 802.16 Broadband Wireless Access; Brief review of 2nd and 3rd generation wireless: GSM, GPRS, CDMA; Cordless system; Wireless local loop; \r\n<br>\r\nBluetooth: overview and baseband specifications.', '', ''),
('CSE_CSE454', 'Undergraduate', 'Wireless Networks Sessional', 0.75, 4, 2, 'Laboratory works based on CSE 453.', '', ''),
('EEE163', 'Undergraduate', 'Introduction to Electrical Engineering', 3, 1, 1, 'Fundamental electrical concepts and measuring units. Direct current: voltage, current, resistance and power. Laws of electrical circuits and methods of network analysis; Introduction to magnetic circuits. Alternating current: instantaneous and r.m.s. current, voltage and power, average power for various combinations of R, L and C circuits, phasor representation of sinusoidal quantities.', '', ''),
('EEE164', 'Undergraduate', 'Introduction to Electrical Engineering Sessional', 1.5, 1, 1, 'Laboratory works based on EEE 163.', '', ''),
('EEE263', 'Undergraduate', 'Electronic Devices and Circuits', 4, 2, 1, 'Introduction to semiconductors, p-type and n-type semiconductors; p-n junction diode characteristics; Diode applications: half and full wave rectifiers, clipping and clamping circuits, regulated power supply using zener diode.\r\n<br>\r\nBipolar Junction Transistor (BJT): principle of operation, I-V characteristics; Transistor circuit configurations (CE, CB, CC), BJT biasing, load lines; BJTs at low frequencies; Hybrid model, h parameters, simplified hybrid model; Small-signal analysis of single and multi-stage amplifiers, frequency response of BJT amplifier.\r\nField Effect Transistors (FET): principle of operation of JFET and MOSFET; Depletion and enhancement type NMOS and PMOS; biasing of FETs; Low and high frequency models of FETs, Switching circuits using FETs; Introduction to CMOS.\r\n<br>\r\nOperational Amplifiers (OPAMP): linear applications of OPAMPs, gain, input and output impedances, active filters, frequency response and noise.\r\nIntroduction to feedback, Oscillators, Silicon Controlled Rectifiers (SCR), TRIAC, DIAC and UJT: characteristics and applications; Introduction to IC fabrication processes.', 'EEE163', ''),
('EEE264', 'Undergraduate', 'Electronic Devices and Circuits Sessional', 1.5, 2, 1, 'Laboratory works based on EEE 263.', '', ''),
('EEE269', 'Undergraduate', 'Electrical Drives and Instrumentation', 3, 2, 2, 'Introduction to three phase circuits, alternators and transformers; Principles of operation of DC, synchronous, induction, universal, and stepper motors; Thyristor and microprocessor based speed control of motors.\r\n<br>\r\nInstrumentation amplifiers: differential, logarithmic and chopper amplifiers; Frequency and voltage measurements using digital techniques; Recorders and display devices, spectrum analyzers and logic analyzers; Data acquisition and interfacing to microprocessor based systems; Transducers: terminology, types, principles and application of photovoltaic, piezoelectric, thermoelectric, variable reactance and opto-electronic transducers; Noise reduction in instrumentation.', 'EEE163', ''),
