('HUM211', 'Undergraduate', 'Sociology', 2, 4, 1, 'Sociological perspective: definition, nature, scope and importance of sociology; Sociology and scientific approach: methods of social research, stages of social research; Primary concepts of sociology: society, community, association, institution, group; Social evolution: stages in the evolution of human civilization; Culture: definition, characteristics, culture contents (material and non-material), cultural lag, culture and civilization; Industrial revolution: the growth of capitalism, features and social consequences, socialism; Social organization: family, forms and functions of family, functions of family in modern industrial society, marriage, forms of marriage, functions of marriage; Social stratification: main types of social stratification â€“ slavery-caste and social class and status, social stratification and social mobility; Social control: religion and morality, custom and public opinion, taboo-law, state and education; Social change: change-evolution-progress-development, factors in social change; Society and population: human migration, population and resources; Some current social problems: crime, deviance, juvenile delinquency, youth unrest; Technology and society: effects of technological factors on social life.', '', ''),
('HUM213', 'Undergraduate', 'Government', 2, 4, 1, 'Some basic concepts of government and politics; Functions, organs and forms of modern state and government; Socialism, Fascism, Marxism.\r\nGovernment and politics of Bangladesh; Some major administrative systems of developed countries; Local self government; Some major aspects of international politics.', '', ''),
('HUM272', 'Undergraduate', 'Developing English Skills Laboratory', 1.5, 1, 2, '<b>Grammar:</b> Tense, article, preposition, subject-verb agreement, clause, conditional and sentence structure.\r\n<br>\r\n<b>Vocabulary building:</b> Correct and precise diction, affixes, level of appropriateness. Colloquial and standard, informal and formal.\r\n<br>\r\n<b>Developing reading skill:</b> Strategies of reading â€“ skimming, scanning, predicting, inferring; analyzing and interpreting variety of texts; practicing comprehension from literary and nonliterary texts.\r\n<br>\r\n<b>Developing writing skill:</b> Sentences, sentence variety, generating sentences; clarity and correctness of sentences, linking sentences to form paragraphs, writing paragraphs, essays, reports, formal and informal letters.\r\n<br>\r\n<b>Listening skill and note taking:</b> Listening to recorded texts and class lectures and learning to take useful notes based on listening.\r\n<br>\r\n<b>Developing speaking skill:</b> Oral skills including communicative expressions for personal identification, life at home, giving advice and opinion, instruction and directions, requests, complaints, apologies, describing people and places, narrating events.', '', ''),
('HUM275', 'Undergraduate', 'Economics', 2, 4, 2, 'Definition of Economics; Economics and engineering; Principles of economics.\r\n<br>\r\n<b>Micro-Economics:</b> Introduction to various economic systems â€“ capitalist, command and mixed economy; Fundamental economic problems and the mechanism through which these problems are solved; Theory of demand and supply and their elasticities; Theory of consumer behavior; Cardinal and ordinal approaches of utility analysis; Price determination; Nature of an economic theory; Applicability of economic theories to the problems of developing countries; Indifference curve techniques; Theory of production, production function,  types of productivity; Rational region of production of an engineering firm; Concepts of market and market structure; Cost analysis and cost function; Small scale production and large scale production; Optimization; Theory of distribution; Use of derivative in economics: maximization and minimization of economic functions, relationship among total, marginal and average concepts.\r\n<br>\r\n<b>Macro-economics:</b> Savings; investment, employment; National income analysis; Inflation; Monetary policy; Fiscal policy and trade policy with reference to Bangladesh; Economics of development and planning.', '', ''),
('HUM371', 'Undergraduate', 'Financial and Managerial Accounting', 2, 4, 2, '<b>Financial Accounting:</b> Objectives and importance of accounting; Accounting as an information system; computerized system and applications in accounting; Recording system: double entry mechanism; Accounts and their classification; Accounting equation; Accounting cycle: journal, ledger, trial balance; Preparation of financial statements considering adjusting and closing entries; Accounting concepts (principles) and conventions. \r\n<br>\r\nFinancial statement analysis and interpretation:  ratio analysis.\r\n<br>\r\n<b>Cost and Management Accounting:</b> Cost concepts and classification; Overhead cost: meaning and classification; Distribution of overhead cost; Overhead recovery method/rate; Job order costing: preparation of job cost sheet and quotation price; Inventory valuation: absorption costing and marginal/variable costing technique; Cost-Volume-Profit analysis: meaning, breakeven analysis, contribution margin approach, sensitivity analysis.\r\n<br>\r\nShort-term investment decisions: relevant and differential cost analysis.\r\n<br>\r\nLong-term investment decisions: capital budgeting, various techniques of evaluation of capital investments.', '', ''),
('HUM411', 'Undergraduate', 'Business Law', 2, 4, 1, 'Principles of law of contracts; Company law: law regarding formation, incorporation, management and winding up of companies; Labor law: law in relation to wages hours, health, safety and other condition to work; The trade union legislation arbitration, the policy of the state in relation to labor; The Factory Act (1965); The Law of compensation (1965).', '', ''),
('IPE493', 'Undergraduate', 'Industrial Management', 3, 4, 1, 'Introduction, evolution, management function, organization and environment.\r\n<br>\r\n<b>Organization:</b> Theory and structure; Coordination; Span of control; Authority delegation; Groups; Committee and task force; Manpower planning.\r\n<br>\r\n<b>Personnel Management:</b> Scope; Importance; Need hierarchy; Motivation; Job redesign; Leadership; Participative management; Training; Performance appraisal; Wages and incentives; Informal groups; Organizational change and conflict.\r\n<br>\r\n<b>Cost and Financial Management:</b> Elements of costs of products depreciation; Break-even analysis; Investment analysis; Benefit cost analysis.\r\n<br>\r\n<b>Management Accounting:</b> Cost planning and control; Budget and budgetary control; Development planning process.\r\n<br>\r\n<b>Marketing Management:</b> Concepts; Strategy; Sales promotion; Patent laws.\r\n<br>\r\n<b>Technology Management:</b> Management of innovation and changes; Technology life cycle; Case studies.', '', ''),
('MATH141', 'Undergraduate', 'Differential Calculus and Co-ordinate Geometry', 3, 1, 1, '<b>Differential Calculus:</b> Limits, continuity and differentiability; Successive differentiation of various types of functions; Leibnizâ€™s Theorem; Rolleâ€™s Theorem; Mean value Theorem in finite and infinite forms; Lagrangeâ€™s form of remainders; Cauchyâ€™s form of remainder; Expansion of functions; Evaluation of indeterminate forms by Lâ€™Hospitalâ€™s rule; Partial differentiation; Eulerâ€™s Theorem; Tangent and Normal, Subtangent and subnormal in cartesian and polar co-ordinates; Maximum and minimum values of functions of single variable; Points of inflexion; Curvature, radius of curvature, center of curvature; Asymptotes, curve tracing.\r\n<br>\r\n<b>Co-ordinate Geometry:</b> Transformation of co-ordinates axes and its uses; Equation of conics and its reduction to standard forms; Pair of straight lines; Homogeneous equations of second degree; Angle between a pair of straight lines; Pair of lines joining the origin to the point of intersection of two given curves, circles; System of circles; Orthogonal circles; Radical axis, radical center, properties of radical axes; Coaxial circles and limiting points; Equations of parabola, ellipse and hyperbola in cartesian and polar co-ordinates; Tangents and normals, pair of tangents; Chord of contact; Chord in terms of its middle points; Pole and polar parametric co-ordinates; Diameters; Conjugate diameters and their properties; Director circles and asymptotes.', '', ''),
('MATH143', 'Undergraduate', 'Integral Calculus, Ordinary and Partial Differential Equations, and Series Solutions', 4, 1, 2, '<b>Integral Calculus:</b> Definitions of integration; Integration by the method of substitutions; Integration by parts; Standard integrals; Integration by the method of successive reduction; Definite integrals and its properties and use in summing series; Walliâ€™s formula, Improper integrals, Beta function and Gamma function; Area under a plane curve in cartesian and polar co-ordinates; Area of the region enclosed by two curves in cartesian and polar co-ordinates; Trapezoidal rule, Simpsonâ€™s rule. Arc lengths of curves in cartesian and polar co-ordinates, parametric and pedal equations; Intrinsic equation; Volume of solids of revolution; Volume of hollow solids of revolution by shell method. Area of surface of revolution; Jacobian, multiple integrals and their application.\r\n<br>\r\n<b>Ordinary Differential Equation (ODE):</b> Degree and order of ordinary differential equations; Formation of differential equations; Solution of first order differential equations by various methods; Solution of first order but higher degree ordinary differential equations; Solution of general linear equations of second and higher orders with constant coefficients; Solution of homogeneous linear equations and its applications; Solution of differential equations of higher order when dependent and independent variables are absent; Solution of differential equation by the method based on factorization of operators.\r\n<br>\r\n<b>Partial Differential Equations (PDE):</b> Four rules for solving simultaneous equations of the form; Lagrangeâ€™s method of solving PDE of order one; Integral surfaces passing through a given curve; Nonlinear PDE of order one (complete, particular, singular and general integrals): standard forms f(p,q) = 0, z = px + qy + f(p,q),  f(p,q,z) = 0, fÂ­1(x,p) = f2(y, q); Charpitâ€™s method; Second order PDE: its nomenclature and classifications to canonical (standard)- parabolic, elliptic, hyperbolic; Solution by separation of variables. Linear PDE with constant coefficients.\r\n<br>\r\n<b>Series Solution:</b> Solution of differential equations in series by the method of Frobenius; Besselâ€™s functions, Legendreâ€™s polynomials and their properties.', '', ''),
('MATH241', 'Undergraduate', 'Complex Variable and Statistics', 3, 2, 1, '<b>Complex Variable:</b> Complex number system; General functions of a complex variable; Limits and continuity of a function of complex variable and related theorems; Complex differentiation and the Cauchyâ€“Riemann Equations; Mapping by elementary functions; Line integral of a complex function; Cauchyâ€™s Integral Theorem; Cauchyâ€™s Integral Formula; Liouvilleâ€™s Theorem; Taylorâ€™s Theorem and Laurentâ€™s Theorem. Singular points; Residue; Cauchyâ€™s Residue Theorem. Evaluation of residues; Contour integration; Conformal mapping.\r\n<br>\r\n<b>Statistics:</b> Frequency distribution; Mean, median, mode and other measures of central tendency; Standard deviation and other measures of dispersion; Moments, skewness and kurtosis; Elementary probability theory and discontinuous probability distribution, (binomial, Poisson and negative binomial); Characteristics of distributions; Elementary sampling theory; Estimation; Hypothesis testing and regression analysis. ', '', ''),
('MATH243', 'Undergraduate', 'Matrices, Vectors, Fourier Analysis, and Laplace Transforms', 4, 2, 2, '<b>Matrices:</b> Definition of matrix; Different types of matrices; Algebra of matrices; Adjoint and inverse of a matrix; Elementary transformations of matrices; Matrix polynomials; Calay-Hamilton theory with uses of rank and nullity; Normal and canonical forms; Solution of linear equations; Eigenvalues and eigenvectors.\r\n<br>\r\n<b>Vector Spaces:</b> Definition and properties, subspaces, basis and dimension, change of basis; Linear Transformation (LT): definition and properties, linear operator matrix, geometry of LT, standard plane LT.\r\n<br>\r\n<b>Vector Algebra:</b> Scalars and vectors, equality of vectors; Addition and subtraction of vectors; Multiplication of vectors by scalars; Scalar and vector product of two vectors and their geometrical interpretation; Triple products and multiple products; Linear dependence and independence of vectors.\r\n<br>\r\n<b>Vector Calculus:</b> Differentiation and integration of vectors together with elementary applications; Definition of line, surface and volume integrals; Gradient, divergence and curl of point functions, various formulae, Gaussâ€™s theorem, Stokeâ€™s theorem, Greenâ€™s theorem.\r\n<br>\r\n<b>Fourier Analysis:</b> Real and complex form of Fourier series; Finite transform; Fourier Integral; Fourier transforms and their uses in solving boundary value problems of wave equations.\r\n<br>\r\n<b>Laplace Transforms:</b> Definition; Laplace transforms of some elementary functions; Sufficient conditions for existence of Laplace transforms; Inverse Laplace transforms; Laplace transforms of derivatives. The unit step function; Periodic function; Some special theorems on Laplace transforms; Partial fraction; Solutions of differential equations by Laplace transforms; Evaluation of improper integrals.', '', ''),
('ME160', 'Undergraduate', 'Mechanical Engineering Drawing-I', 1.5, 1, 1, 'Introduction; Instruments and their uses; First and third angle projections; Orthographic drawings; Isometric views; Missing lines and views; Sectional views and conventional practices; Auxiliary views.', '', ''),
('ME165', 'Undergraduate', 'Basic Mechanical Engineering', 3, 1, 1, 'Sources of energy: conventional and renewable; Introduction to IC engines, Refrigeration and Air conditioning systems. \r\nStatics of particles and rigid bodies; Forces in trusses and frames; Relative motion; Kinematics of particles: Newton''s Second Law of Motion; Kinematics of rigid bodies.\r\n<br>\r\nIntroduction to Robotics; Plane, rotational and spatial motion with applications to manipulators; Geometric configurations: structural elements, linkage, arms and grippers; Motion characteristics.', '', ''),
('PHY102', 'Undergraduate', 'Physics Sessional', 1.5, 1, 1, 'Laboratory works based on PHY 109.', '', ''),
('PHY109', 'Undergraduate', 'Physics (Heat and Thermodynamics, Structure of Matter, Waves and Oscillations, and Physical Optics)', 4, 1, 1, '<b>Heat and Thermodynamics:</b> Principle of temperature measurements: platinum resistance thermometer, thermo-electric thermometer, pyrometer; Kinetic theory of gases: Maxwell''s distribution of molecular speeds, mean free path, equipartition of energy, Brownian motion, Van der Waal''s equation of state, review of the First Law of thermodynamics and its application, reversible and irreversible processes, Second Law of thermodynamics, Carnot cycle; Efficiency of heat engines, Carnot''s Theorem, entropy and disorder, thermodynamic functions, Maxwell relations, Clausius-Clapeyron Equation, Gibbs Phase Rule, Third Law of thermodynamics.\r\n<br>\r\n<b>Structure of Matter:</b> Crystalline and non-crystalline solids, single crystal and polycrystal solids, unit cell, crystal systems, co-ordinations number, crystal planes and directions, sodium chloride and CsCl structure, packing factor, Miller indices, relation between interplanar spacing and Miller indices, Bragg''s Law, methods of determination of interplanar spacing from diffraction patterns; Defects in solids: point defects, line defects; Bonds in solids, inter-atomic distances, calculation of cohesive and bonding energy; Introduction to band theory: distinction between metal, semiconductor and insulator.\r\n<br>\r\n<b>Waves and Oscillations:</b> Differential equation of a simple harmonic oscillator, total energy and average energy, combination of simple harmonic oscillations, Lissajous'' figures, spring-mass system, calculation of time period of torsional pendulum, damped oscillation, determination of damping co-efficient, forced oscillation, resonance, two-body oscillations, Reduced mass, differential equation of a progressive wave, power and intensity of wave motion, stationary wave, group velocity and phase velocity, architectural acoustics, reverberation and Sabine''s formula.\r\n<br>\r\n<b>Physical Optics:</b> Theories of light; Interference of light, Young''s double slit experiment; Displacements of fringes and its uses; Fresnel Bi-prism, interference at wedge shaped films, Newton''s rings, interferometers; Diffraction of light: Fresnel and Fraunhoffer diffraction, diffraction by single slit, diffraction from a circular aperture, resolving power of optical instruments, diffraction at double slit & N-slits-diffraction grating; Polarization: production and analysis of polarized light, Brewster''s law, Malus law, Polarization by double refraction, retardation plates, Nicol prism, optical activity, polarimeters, polaroid.', '', '');
