INSERT INTO `fac_list` (`fac_name`, `fac_login`, `fac_desig`, `fac_tele_res`, `fac_tele_off`, `fac_tele_cell`, `fac_email`, `fac_home_addr`, `fac_web`, `fac_research_int`, `fac_pic_url`, `fac_joining_date`, `fac_on_leave`, `fac_education`, `fac_publications`, `fac_bangla_name`) VALUES
('Md. Aashikur Rahman Azim', 'aashik', 'Lecturer', '', '', '+880-1717-032394', 'aashikazim AT gmail DOT com, aashik_azim AT cse DOT buet DOT ac DOT bd', 'Room no.: 415 <br>\r\nDepartment of Computer Science & Engineering <br> \r\nBangladesh University of Engineering & Technology <br>\r\nECE Building, West Palashi<br>\r\nDhaka-1000, Bangladesh.<br>', 'http://teacher.buet.ac.bd/aashik_azim/', 'Bioinformatics <br>\r\nArtificial Intelligence <br>\r\nEmbedded Systems <br>', 'aashik541726_10200494463580008_939722715_n.jpg', 7600, 0, 'B.Sc. in Computer Science & Engineering, 2013 <br>\r\nBUET, Dhaka, Bangladesh.<br>\r\n<br>\r\nH.S.C (Science), 2007<br>\r\nDhaka College, Dhaka, Bangladesh.<br><br>\r\n\r\nS.S.C (Science), 2005<br>\r\nBheola Manik Char High School, Chakaria, Cox''s Bazar, Bangladesh.', '', 'মোঃ আশিকুর রহমান আজিম'),
('Dr. Muhammad Abdullah Adnan', 'adnan', 'Assistant Professor', '880 2 9665650/7423', '880 2 9665650/7109', '880 1552336926', 'abdullah.adnan@gmail.com, adnan@cse.buet.ac.bd', 'Room No: 521<br>\r\nDepartment of Computer Science and Engineering<br>Bangladesh University of Engineering and Technology<br>Dhaka 1000, Bangladesh', 'https://sites.google.com/site/abdullahadnan', 'Cloud & Mobile Computing<br>\r\nBIG DATA<br>\r\nGreen Computing & Energy Efficiency<br>\r\nData Center Networking<br>\r\nEmbedded Systems and Software<br>Smart Grid & Internet of Things<br>\r\nComputational Geometry<br>Combinatorial Algorithms\r\n<br><br>\r\n<b><font color="red">Notice:</font></b> I am recruiting PhD and masters students for research in the areas of Cloud Computing, Mobile Computing and Smart Grid. Interested students are requested to contact me.<br>', 'adnanAdnanweb2.jpg', 3300, 0, 'PhD in Computer Science and Engineering, 2015<br>\r\nUniversity of California San Diego, California, USA<br><br>\r\nM.Sc. in Computer Science and Engineering, 2008<br>\r\nBangladesh University of Engineering and Technology<br><br>\r\nB.Sc. in Computer Science and Engineering, 2006<br>\r\nBangladesh University of Engineering and Technology\r\n<br>\r\n', '<br>\r\n1. Muhammad Abdullah Adnan, Balakrishnan Narayanaswamy and Rajesh Gupta, "Online Reservation and Deferral of EV Charging Tasks to Reduce Energy Use Variability in Smart Grids," Proc. of IEEE International Conference on Smart Grid Communications (SmartGridComm), Venice, Italy 2014. [pdf] <br> <br>\r\n2. Muhammad Abdullah Adnan and Rajesh Gupta, "Workload Shaping to Mitigate Variability in Renewable Power Use by Data Centers," Proc. of IEEE International Conference on Cloud Computing (CLOUD), Alaska, USA, June 2014. (Acceptance rate 20%) [pdf] <br><br>\r\n3. Muhammad Abdullah Adnan, Ryo Sugihara, Yan Ma and Rajesh Gupta, "Energy-Optimized Dynamic Deferral of Workload for Capacity Provisioning in Data Centers", Proc. of International Green Computing Conference (IGCC), Arlington, VA, USA, June 2013. [pdf] <br><br>\r\n4. Muhammad Abdullah Adnan and Rajesh Gupta, "Path Consolidation for Dynamic Right-sizing of Data Center Networks," Proc. of IEEE International Conference on Cloud Computing (CLOUD), Santa Clara, USA, June 2013. [pdf] <br><br>\r\n5. Muhammad Abdullah Adnan and Rajesh Gupta, "Utility-Aware Deferred Load Balancing in the Cloud Driven by Dynamic Pricing of Electricity," Proc. of ACM/IEEE Design Automation and Test in Europe (DATE), Grenoble, France, March 2013. [pdf] <br><br>\r\n6. Muhammad Abdullah Adnan, Ryo Sugihara and Rajesh Gupta, "Energy Efficient Geographical Load Balancing via Dynamic Deferral of Workload," Proc. of IEEE International Conference on Cloud Computing (CLOUD), Honolulu, Hawaii, USA, June 2012. (Acceptance rate 48/282 = 17%) [pdf] <br><br>\r\n7. Muhammad Abdullah Adnan, Ifat Afrin, Masud Hasan, Tahmina Khanam, and Mir Monjur-al-Mahmud, "Zonohedra, Zone Graphs, and Their Linear Area Straight Line Grid Drawings," Proc. of Workshop on Graph Drawing and Graph Algorithms (GDGA), 2012. <br><br>\r\n8. Md. Abul Hassan Samee, Md. Jawaherul Alam, Muhammad Abdullah Adnan and Md. Saidur Rahman, "Minimum segment drawings of series-parallel graphs with the maximum degree three", Proc. of the 16th International Symposium on Graph Drawing (GD 2008), Crete, Greece, LNCS 5417, pp. 408–419, 2009. [pdf] <br><br>\r\n9. Muhammad Abdullah Adnan and Md. Saidur Rahman, “Distribution of distinguishable objects to bins: generating all distributions”, Proc. of Workshop on Algorithms and Computation (WALCOM 2007), pp. 136-150, 2007. [pdf] <br><br>\r\n10. Muhammad Abdullah Adnan and Md. Saidur Rahman, “Efficient generation of evolutionary trees”, Proc. of International Conference on Information and Communication Technology (ICICT 2007), pp. 32-35, 2007. [pdf] <br><br>\r\n11. Muhammad Abdullah Adnan and Md. Saidur Rahman, “Distribution of objects to bins: generating all distributions”, Proc. of 9th International Conference on Computer and Information Technology (ICCIT 2006), pp. 297-302, 2006. [pdf]<br><br>\r\n12. Muhammad Abdullah Adnan and Md. Saidur Rahman, “Generating all distributions of objects to bins”, International Journal of Computer Mathematics, London, UK,  Vol. 86, No. 3, pp. 383-392, 2009. [pdf] <br><br>\r\n13. Muhammad Abdullah Adnan and Md. Saidur Rahman, “Distribution of distinguishable objects to bins: generating all distributions”, International Journal of Computer Mathematics, London, UK, Vol. 84, No. 7, pp. 953-965, 2007. [pdf] <br><br>\r\n14. Muhammad Abdullah Adnan and Md. Saidur Rahman, “Efficient generation of evolutionary trees”, INFOCOMP Journal of Computer Science, Brazil, Vol. 6, No. 1, pp. 30-36, 2007. [pdf]<br><br>', 'মুহাম্মদ আবদুল্লাহ আদনান'),
