uet.ac.bd/ashikur/jquery.js"></script>\r\n<div id="wowslider-container1">\r\n<div class="ws_images"><ul>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic1.jpg" alt="" title="" id="wows1_0"/></li>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic3.jpg" alt="undergrad2" title="undergrad2" id="wows1_1"/></li>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic4.jpg" alt="undergrad3" title="undergrad3" id="wows1_2"/></li>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic6.jpg" alt="undergrad4" title="undergrad4" id="wows1_3"/></li>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic7.jpg" alt="undergrad5" title="undergrad5" id="wows1_4"/></li>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic5.jpg" alt="undergrad6" title="undergrad6" id="wows1_5"/></li>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic9.jpg" alt="undergrad7" title="undergrad7" id="wows1_6"/></li>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic10.jpg" alt="undergrad8" title="undergrad8" id="wows1_7"/></li>\r\n<li><img src="http://teacher.buet.ac.bd/ashikur/pic11.jpg" alt="undergrad9" title="undergrad9" id="wows1_8"/></li>\r\n</ul></div>\r\n<!-- Generated by WOWSlider.com v4.1 -->\r\n	<div class="ws_shadow"></div>\r\n	</div>\r\n	<script type="text/javascript" src="http://teacher.buet.ac.bd/ashikur/wowslider.js"></script>\r\n	<script type="text/javascript" src="http://teacher.buet.ac.bd/ashikur/script.js"></script>\r\n	<!-- End WOWSlider.com BODY section -->\r\n</div>\r\n<center> <font color="#FF00FF" size="2"> BUET: a place where quality is never compromised. </font></center>\r\n<br>\r\n  <li><b>Wireless Ad hoc and Sensor Networks</b> </li>\r\n  <ul>\r\n    <li><i>Routing</i>:The path problem and relavent optimisation criteria. </li>\r\n    <ul>\r\n        <li>Location-based routing, Power-aware routing, QoS routing.</li>\r\n    </ul>\r\n    <li><i> Medium Access Control Layer Issues:</i> Enhancing reliability, </li>\r\n    <ul>\r\n        <li> Reliable unicast, multicast and broadcast transmission,\r\nCollision avoidance. </li>\r\n    </ul>\r\n    <li> <i>Power Optimisation:</i> Topology control for energy-efficiency.</li>\r\n    <li><i>Capacity Analysis:</i> Performance bounds and Capacity limit.</li>\r\n  </ul>\r\n  <li><b>Back-end optimisation of Compiler</b><br>\r\n  </li>\r\n  <ul>\r\n    <li><i>Loop optimisation</i>: Loop Fusion and Fission, scalar optimization,\r\nalias analysis.</li>\r\n  </ul>\r\n  <li><b>Neural Network</b><br>\r\n  </li>\r\n  <ul>\r\n    <li>Image compression </li>\r\n  </ul>\r\n  <li><b>Thin Client Architecture</b></li>\r\n  <ul>\r\n    <li>Optimising thin clients</li>\r\n    <li>Thin clients on small wireless devices</li>\r\n    <li>Server-Based Computing<br>\r\n    </li>\r\n  </ul>\r\n</ul>\r\n<ul>\r\n  <ul>\r\n    <ul> \r\n    </ul> \r\n  </ul>\r\n<!--\r\n<b><font color="#FF00FF" size="2">\r\nIF YOU CANNOT DO GREAT THINGS, DO SMALL THINGS IN A GREAT WAY</font></b>\r\n<p>\r\n<br>\r\n<b><font color="#FF00FF" size="2">\r\nTHE ONLY TIME "SUCCESS" COMES BEFORE "WORK" IS IN THE DICTIONARY.</font></b>\r\n<p>\r\n<br>\r\n<br>\r\n<p>\r\n<b>\r\n<font color="#660033" size="2">\r\n<img src="http://teacher.buet.ac.bd/ashikur/NEW_animated.gif" alt="" /> We will be recruiting a number of M.Sc. and Ph.D. students for our newly funded research project "Remote health monitoring in Bangladesh". <u>\r\n<a href="http://teacher.buet.ac.bd/ashikur/poster_Scholarship_Recruitment.pdf">\r\nThe details are here</a>. </u>Please fill out this <a href="http://teacher.buet.ac.bd/ashikur/Application-MSc-Scholarship _3_.pdf"> application form </a> and submit if interested. \r\n</font>\r\n</b>\r\n</br>\r\n-->', 'ashikurrahmanarahman.jpg', 1750, 0, '<style>\r\nCSSTableGenerator {\r\n	margin:0px;padding:0px;\r\n	width:100%;\r\n	box-shadow: 10px 10px 5px #888888;\r\n	border:1px solid #000000;\r\n	\r\n	-moz-border-radius-bottomleft:14px;\r\n	-webkit-border-bottom-left-radius:14px;\r\n	border-bottom-left-radius:14px;\r\n	\r\n	-moz-bord