onferences is a serious waste of time and an impediment to creativity.\r\n</font> \r\n</td>\r\n</tr>\r\n</table>\r\n<p>\r\n<b> Before downloading the documents in this page, please carefully read the <a href="http://teacher.buet.ac.bd/ashikur/CR.htm"> copyright notice. </a>\r\n</b>\r\n<p>\r\n<b><font color="#3300FF" size="4"> <a name="pub"></a>\r\nBook </font></b> \r\n<ol type="1">\r\n<li> Ashikur Rahman, <a \r\nhref="http://www.amazon.com/exec/obidos/ASIN/3639157079/ref=nosim/gettextbooks-20">"<i>Routeless Routing and MAC-Aided Protocols for Adhoc Wireless Network</i>" </a>, June 05, 2009, Publisher: VDM Verlag, ISBN: 978-3-639-15707-9.\r\n</li>\r\n</ol>\r\n<p>\r\n<b><font color="#3300FF" size="4"> <a name="pub"></a>\r\nJournal </font></b> \r\n<p>\r\n<ol type="1" start="2">\r\n<p>\r\n<li>\r\n<table border="0" style="width:100%;">\r\n<tr>\r\n<td>\r\n<img src="http://teacher.buet.ac.bd/ashikur/new.jpg" width="70%" height="30%" alt="" />\r\n</td>\r\n<td>\r\n<ol type="1" start="2">\r\n<li>\r\nAshikur Rahman, Xue Liu and Fanxin Kong"<i><a  \r\nhref="http://teacher.buet.ac.bd/ashikur/myPapers/SurveyGeographicLoadBalancing.pdf"> A Survey on\r\nGeographic Load Balancing based Data Center Power Management in the Smart Grid\r\nEnvironment </i></a>", IEEE Communication Surveys & Tutorials, \r\n<font color="#330FFF">\r\nVolume 16, No. 1, February, 2014, Pages 214--233\r\n </font>  <a href="http://libguides.newcastle.edu.au/content.php?pid=277617&sid=2477976"> \r\nJournal Impact Factor: 5.49\r\n </a> \r\n</li>\r\n</td>\r\n</tr>\r\n</table>\r\n</li>\r\n<p>\r\n<li>\r\nMd. Ehtesamul Haque and Ashikur Rahman, "<i><a  \r\nhref="http://teacher.buet.ac.bd/ashikur/myPapers/ahsn.pdf"> On Constructing\r\nInterference-Aware k-Fault Resistant Topologies for Wireless Ad hoc \r\nnetworks </i></a>", Ad Hoc & Sensor Wireless Networks( <a href="http://www.oldcitypublishing.com/AHSWN/AHSWN.html"> \r\n <a href="http://www.oldcitypublishing.com/AHSWN/AHSWN.html"> (AHSWN) </a> \r\n<font color="#330FFF">, To Appear 2012</font>.\r\n</li>\r\n<p> \r\n<li>\r\nSyed Rafiul Hussain, Subrata Saha and Ashikur Rahman,<a \r\nhref="http://teacher.buet.ac.bd/ashikur/myPapers/SAAMAN.pdf"><i>SAAMAN: Scalable Address \r\nAutoconfiguration in Mobile Ad Hoc Networks </i>"</a>,Journal of Network \r\nand System Management (<a \r\nhref="http://www.springer.com/computer/communication+networks/journal/10922"> \r\nJNSM </a>), Volume 9, Issue 3(2011), Page 394, DOI: \r\n10.1007/s10922-010-9187-4, \r\nSpringer ISSN: 1064-7570. \r\n</li>\r\n<p> \r\n<li>\r\nP. Gburzynski, B. Kaminska, and A. Rahman. "<a href="http://teacher.buet.ac.bd/ashikur/myPapers/Hundai.pdf"><i>On Reliable One-way Transmission of Data over Simple Wireless Channels</i>."</a> , Journal of Computer Systems, Networks, and Communications (JCSNC),  Volume 2009 (2009), Article ID 409853, 14 pages. \r\n</li>\r\n\r\n<p>\r\n<li>\r\nAshikur Rahman and Pawel Gburzynski, "<a href="http://teacher.buet.ac.bd/ashikur/myPapers/MAC-AssistedTopology.pdf"><i>MAC-Assisted \r\nTopology Control for Ad-hoc Wireless Network</i>"</a>, ACM/Wiley International Journal of Communication Systems <a \r\nhref=http://www3.interscience.wiley.com/cgi-bin/abstract/112226497/ABSTRACT>\r\n(IJCS), 19(9):955-976. </a>\r\n</li>\r\n\r\n<p>\r\n<li>\r\nA. Rahman, M. Ahmed and S. Zerin "<i><a href="http://teacher.buet.ac.bd/ashikur/myPapers/SIMUL_2009_Low.pdf">Analysis of Minimum-Energy \r\nPath-Preserving Graphs for Ad-hoc Wireless Networks</a> </i>", in Transactions of the Society for Modeling and Simulation International, 2009.\r\n</li>\r\n<p>\r\n<li>\r\nA. Rahman, M.E. Hoque, F. Rahman, S. K. Kundu, and P. Gburzynski, "<i><a href="http://teacher.buet.ac.bd/ashikur/myPapers/EPDP_paper_journal.pdf">Enhanced Partial Dominant Pruning \r\n(EPDP) Based Broadcasting in Ad hoc Wireless Networks</a> </i>", Journal of Networks, Vol 4, No 9 (2009), 895-904, \r\ndoi:10.4304/jnw.4.9.895-904\r\n</li>\r\n</ol>\r\n<p>\r\n\r\n<b><font color="#3300FF" size="4"> Conferences <