ach for continuous optimization, “ <i> Applied Soft Computation, </i> vol. 12,  pp. 1693-1707, 2012.\r\n<br><br>\r\n\r\n2.	Mohammad Shafiul Alam, <b> Md. Monirul Islam</b>, Xin Yao, and K. Murase, "Recurring Two-Stage Evolutionary Programming: A Novel Approach for Numeric Optimization," <i> IEEE Transactions on Systems, Man, and Cybernetics, Part B, </i> vol. 41, pp. 1352-1365, 2011. \r\n<br> <br>\r\n\r\n3.	Md. Monirul Kabir, <b> Md. Monirul Islam </b>, and K. Murase, "A New Wrapper Feature Selection Approach using Neural Network," <i> Neurocomputing,</i> vol. 73, pp. 3273-3283, 2010.\r\n<br> <br>\r\n\r\n4.	Md. Rakib Hassan, <b> Md. Monirul Islam </b>, and K. Murase, "A New Local Search Based Ant Colony Optimization Algorithm for Solving Combinatorial Optimization Problems," <i> IEICE Transactions on Information and Systems, </i> vol. E93-D, pp. 1127-1136, 2010.\r\n<br> <br>\r\n\r\n5.	M.A.H. Akhand, <b> Md. Monirul Islam </b>, and K. Murase, "Progressive Interactive Training: A Sequential Neural Network Ensemble Learning Method," <i> Neurocomputing,</i> vol. 73, pp. 260-273, 2009.\r\n<br> <br>\r\n\r\n6.	<b> Md. Monirul Islam </b>, Md. Abdus Sattar, Md. Faijul Amin, Xin Yao, and K. Murase, "A New Constructive Algorithm for Architectural and Functional Adaptation of Artificial Neural Network," <i> IEEE Transactions on Systems, Man, and Cybernetics, Part B,</i> vol. 39,  pp. 1590-1605, 2009.\r\n<br> <br>\r\n\r\n7.	M.A.H. Akhand, <b> Md. Monirul Islam </b>, and K. Murase, "Comparative Study of Data Sampling Techniques for Constructing Neural Network Ensembles," <i> International Journal of Neural Systems,</i> vol. 19,  pp. 67-89, 2009.\r\n<br> <br>\r\n\r\n8.	Mashud Hyder, <b> Md. Monirul Islam </b>, M.A.H. Akhand, and K. Murase, "Symmetry axis based object recognitioon under translation, rotation and scaling,"  <i> International  Journal of Neural Systems,</i> vol. 19,  pp. 25-42, 2009.\r\n<br> <br>\r\n\r\n9.	Md. Faijul Amin, <b> Md. Monirul Islam </b>, and K. Murase, "